import React from "react";

import Page from "../../components/Page";

import { GoogleMap, LoadScript, Marker } from "@react-google-maps/api";

const googleMapsApiKey = "AIzaSyD-7jpeDG9ubMB0DsJ_T8Xpm9nwbrpFK2g";

const mapOptions = {
  fullscreenControl: false,
  panControl: false,
  zoomControl: false,
  mapTypeControl: false,
  streetViewControl: false,
  minZoom: 11,
  maxZoom: 20,
};

const center = {
  lat: 4507088.9938378,
  lng: 14141177.9109503,
};

function Index() {
  return (
    <Page title="CONTACTS">
      <LoadScript
        googleMapsApiKey={googleMapsApiKey}
        loadingElement={
          <Grid
            container
            justifyContent="center"
            alignItems="center"
            sx={{ height: "100%", width: "100%", backgroundColor: "black" }}
          >
            <CircularProgress color="success" />
          </Grid>
        }
      >
        <GoogleMap
          mapContainerStyle={{ width: "100%", height: "100%" }}
          center={center}
          zoom={13}
          options={mapOptions}
          onDragEnd={() => {
            setCenter({
              lat: mapRef.current.getCenter().lat(),
              lng: mapRef.current.getCenter().lng(),
            });
          }}
        >
          <Marker
            key={1}
            icon="/images/icon/current_location.png"
            position={currLocation}
          />
        </GoogleMap>
      </LoadScript>
    </Page>
  );
}

export default Index;
